tables.table_schema:
CREATE TABLE Manufacturing_Processes (
  process_id INT PRIMARY KEY,
  process_name VARCHAR(50),
  process_description TEXT
);

CREATE TABLE 3D_Printing_Data (
  print_id INT PRIMARY KEY,
  print_name VARCHAR(50),
  print_material VARCHAR(50),
  print_duration INT
);

CREATE TABLE printing_materials (
  material_id INT PRIMARY KEY,
  material_name VARCHAR(255) NOT NULL,
  stock_quantity INT
);

CREATE TABLE printing_machines (
  machine_id INT PRIMARY KEY,
  machine_name VARCHAR(255) NOT NULL,
  manufacturer VARCHAR(255),
  purchase_date DATE
);

CREATE TABLE manufacturing_processes (
  process_id INT PRIMARY KEY,
  process_name VARCHAR(255) NOT NULL,
  process_description TEXT
);

CREATE TABLE product_designs (
  design_id INT PRIMARY KEY,
  design_name VARCHAR(255) NOT NULL,
  designer_name VARCHAR(255),
  design_file_path VARCHAR(255)
);

CREATE TABLE production_orders (
  order_id INT PRIMARY KEY,
  order_date DATE,
  product_id INT,
  quantity INT
);
